static inline uint16_t sjis_to_codepoint1(uint8_t const b1) {
  if (b1 <= 0x80) {
    return b1;
  } else if (b1 >= 0xa1 && b1 <= 0xdf) {
    return (0xff61 - 0xa1) + b1; // Half-width katakana
  }
  return 0xfffd;
}

static inline uint16_t sjis_to_codepoint2(uint8_t const b1, uint8_t const b2) {
  // Based on https://encoding.spec.whatwg.org/#shift_jis
  if ((0x81 <= b1 && b1 < 0xa0) || (0xe0 <= b1 && b1 < 0xfd)) {
    uint8_t const lead_offset = b1 < 0xa0 ? 0x81 : 0xc1;
    uint8_t const offset = b2 < 0x7f ? 0x40 : 0x41;
    if ((0x40 <= b2 && b2 <= 0x7e) || (0x80 <= b2 && b2 <= 0xfc)) {
      uint16_t const ptr = (b1 - lead_offset) * 188 + b2 - offset;
      if (ptr >= 8836 && ptr <= 10715) {
        return 0xe000 - 8836 + ptr;
      }
      if (ptr < sizeof(jis0208) / sizeof(jis0208[0])) {
        uint16_t codepoint = jis0208[ptr];
        if (codepoint != 0) {
          return codepoint;
        }
      }
    }
  }
  return 0xfffd;
}

size_t ov_sjis_to_codepoint(ov_codepoint_fn fn, void *ctx, char const *const src, size_t const src_len) {
  assert(fn != NULL && "fn must not be NULL");
  assert(src != NULL || src_len == 0 && "src must not be NULL when src_len > 0");
  if (!fn || (!src && src_len > 0)) {
    return 0;
  }
  size_t i = 0;
  while (i < src_len) {
    uint16_t codepoint;
    size_t const previ = i;
    uint8_t const b1 = (uint8_t)src[i++];
    if ((b1 < 0x80) || (b1 > 0xa0 && b1 < 0xe0)) {
      codepoint = sjis_to_codepoint1(b1);
    } else if (i < src_len) {
      codepoint = sjis_to_codepoint2(b1, (uint8_t)src[i++]);
    } else {
      codepoint = 0xfffd;
    }
    switch (fn(codepoint, ctx)) {
    case ov_codepoint_fn_result_continue:
      continue;
    case ov_codepoint_fn_result_abort:
      return previ;
    case ov_codepoint_fn_result_finish:
      return i;
    }
  }
  return i;
}
